# Função Bubble Sort
def bubble_sort(lista):
    # Desordem é uma variável que serve para dar condição ao While, quando a quantidade de movimentos feitos for 0
    # a variável Desordem recebe o valor 0, assim parando a repetição
    desordem = 1
    movimentos = 0
    while desordem==1:
        # O For recebe um range tamanho de lista -1 para que não de out of range quando for comparar o último elemento
        # da lista,pois caso fosse apenas tamanho da lista o lista[x+1] não ia ter elemento para comparar e ia dar erro
        for x in range(len(lista)-1):
            # Lista[x] compara o elemento do indice x com o próximo elemento lista[x+1], caso o próximo elemento seja
            # menor que o elemento atual, eles trocam de lugar, caso não sejam, apenas mantem a posição
            if lista[x]>lista[x+1]:
                lista[x] , lista[x+1] = lista[x+1], lista[x]
                movimentos+=1
        # Se movimentos == 0 quer dizer que não há elementos a serem ordenados,culminando no fim da execução.
        if movimentos == 0:
            desordem = 0
        movimentos = 0
    return lista
# Teste do algoritmo
print(bubble_sort(decrescente))